import React from 'react';
import './Header.css';

function Header() {
    return (
        <div id = "header">
            <a href = "http://localhost:3000/">
                <img src = "https://avatars2.githubusercontent.com/u/61527805?s=200&v=4"/>
            </a>
        </div>
    );
}

export default Header;
